function App(){
  return(
    <>
      <div className="w-1/3 min-h-[100px]">
        <div className="input m-b-100px">
          <input placeholder="Enter Your Task"></input>
          <button>+</button>
        </div>

        <div className="outer bg-zinc-200 w-full h-[100%] ">
        
          <div className=''>

          </div>
        </div>
      </div>
      
    </>
  )
}

export default App;
